var pdfMake = require('pdfmake/build/pdfmake')
var pdfFonts = require('pdfmake/build/vfs_fonts')
pdfMake.vfs = pdfFonts.pdfMake.vfs;

var moment = require('moment')

const { getResep } = require("../models/tlmDownloadResep")

const logoKlinik = 'data:image/png;base64,'

const logoResep = 'data:image/png;base64,'

/* Download PDF */
const download = async (req, res) => {
    const param = req.query
    var date = new Date()
    
    try {

    const dataResep = await getResep(param)

    var resep = []

    dataResep.forEach(d => {
        resep.push([d.nama_obat, d.jumlahobat_resep, d.jenisobat_resep, d.penggunaanobat_resep])
    })

    var umur = moment().diff(dataResep[0].tgllahir_pasien, 'years')

    if(dataResep ==0){
      return res.status(400).send({ message: "Data not found" })
    }

    var docDefinition = {
        pageSize: 'A5',
        pageMargins: [ 10, 10, 10, 50 ],
        footer: {
            columns: [
                {text: 'Pro : ' + dataResep[0].nama_pasien, alignment: 'left', margin: [30, 0, 0, 5]},
                {text: 'Umur: ' + umur, alignment: 'right', margin: [0, 0, 30, 5]},
                {text: 'Obat tsb. tidak boleh diganti tanpa sepengetahuan dokter ', alignment: 'center', margin: [0, 0, 30, 5], fontSize: 9}
            ],
        },
        content: [
            {
                table: {
                headerRows: 2,
                widths: [100, '*'],
                body: [
                    [ 
                        { image: logoKlinik, width: 100, rowSpan: 2}, 
                        { text: dataResep[0].namaFaskes, bold: true, alignment: 'center', fontSize: 18 } 
                    ],
                    [ '', { text: dataResep[0].alamatFaskes, alignment: 'center', fontSize: 11 } ],
                ],
                
                },
                layout: 'noBorders'
            },
            {
                table: {
                        widths: ['*'],
                        body: [[" "], [" "]]
                },
                layout: {
                    hLineWidth: function(i, node) {
                        return (i === 0 || i === node.table.body.length) ? 0 : 1
                    },
                    vLineWidth: function(i, node) {
                        return 0
                    },
                }
            },
            { text : dataResep[0].nama_kota + ', ' + moment(date).format('DD/MM/YYYY'), style: 'date'},
            { text : 'Nama dokter : ' + dataResep[0].nama_dokter, style: 'dokter'},
            { text : 'SIP : ' + dataResep[0].sip_dokter, style: 'dokter'},
            {
                image: logoResep,
                width: 80,
            },
            {
                style: 'tableResep',
                table: {
                    widths: ['*', '*', '*', '*'],
                    body: resep
                },
                layout: 'noBorders'
            },   
        ],
        styles: {
            date: {
                fontSize: 12,
                alignment: 'right',
                margin: [0, 0, 0, 10]
            },
            dokter: {
                fontSize: 11,
                alignment: 'left',
                margin: [0, 0, 0, 1]
            },
            pasien: {
                fontSize: 11,
                alignment: 'left',
                margin: [0, 5, 0, 5]
            },
            tableResep: {
                fontSize: 10,
                alignment: 'left',
            }
        },
    }

    var timestamp = [
      date.getHours(),
      date.getMinutes(),
      date.getSeconds(),
      date.getDate(),
      date.getMonth() + 1,
      date.getFullYear(),
    ];
    var newTimestamp = timestamp.map((row) => row).join("")

    const pdfDoc = pdfMake.createPdf(docDefinition)
    pdfDoc.getBase64((data) => {
        res.writeHead(200,
            {
                'Content-Type' : 'application/pdf',
                'Content-Disposition' : `attachment;filename="resep_${newTimestamp}.pdf"`
            })
            const download = Buffer.from(data.toString('utf-8'), 'base64')
            res.end(download)
    });
    
    } catch (err) {
    res.status(500).send({
      message: "Could not download the file. " + err,
    })
    }
}

module.exports = { download }